<script>
    async function getResult(operand1, operand2, operation, animDelay) {
        $('#operand1').attr("disabled", true);

        $('#result').text(`${x[0]}`);
        $('#cycles').text(`${x[1]}`);
        $("#submit").attr("disabled", false);
        $('#animDelay').attr("disabled", false);
        $('input[type=radio]').attr("disabled", false);
        $('#operand2').attr("disabled", false);
        $('#operand1').attr("disabled", false);
    }

        var animDelay = $("input[name=animDelay]:checked").val() ? 1 : 0;

        getResult(operand1.toString(), operand2.toString(), operation, animDelay);
    });

<script>
    window.onload = function () {
        sources.forEach((source) => {
            var newItem = document.createElementNS("http://www.w3.org/2000/svg", "circle");
            newItem.setAttribute("cx", source[0]);
            newItem.setAttribute("cy", source[1]);
            newItem.setAttribute("r", 1);
            newItem.setAttribute("class", "src");
            document.getElementById("toy").appendChild(newItem);
        });
    };

    const addend1 = [[205.2, 345.8, 1128], [324.1, 345.8, 734], [443.0, 345.8, 553], [561.8, 345.8, 135],
    [680.7, 345.8, 53], [799.6, 345.8, 394], [918.4, 345.8, 41], [1037.3, 345.8, 583]];
    const addend2 = [[211.5, 345.8, 29], [330.4, 345.8, 324], [449.2, 345.8, 722], [568.1, 345.8, 1140],
    [686.9, 345.8, 65], [805.8, 345.8, 614], [924.7, 345.8, 1057], [1043.5, 345.8, 1195]];
    const out = [613, 977, 1087, 453, 459, 866, 777, 810];

    // element id lookup table
    let table = {};
    segments.forEach((seg, idx) => {
        table[idx] = { x1: seg[0], y1: seg[1], x2: seg[2], y2: seg[3] };
    });

    // k-d tree
    let kdPoints = [];
    segments.forEach((seg, idx) => {
        let endpoint1 = { x: seg[0], y: seg[1], id: idx };
        let endpoint2 = { x: seg[2], y: seg[3], id: idx };
        kdPoints.push(endpoint1);
        kdPoints.push(endpoint2);
    });

    distance = (a, b) => Math.pow(a.x - b.x, 2) + Math.pow(a.y - b.y, 2);

    slope = (seg) => seg.x1 === seg.x2 ? Infinity : (seg.y2 - seg.y1) / (seg.x2 - seg.x1);

    let tree = new kdTree(kdPoints, distance, ["x", "y"]);
    let visited = new Set();
    let on = new Set();

    main = (num1, num2, op, anim_delay = 0) => {
        // clear svg diagram and visited, on sets
        var allSegments = $("svg.toy > *");
        allSegments.removeClass("on");
        allSegments.removeClass("off");
        visited = new Set();
        on = new Set();

        // validate operand input
        if (num1.length !== 8 || num2.length !== 8) return ['Error', 'Operands must be 8 bits in length'];
        let set = new Set(num1 + num2);
        set.delete('0');
        set.delete('1');
        if (set.size > 0) return ['Error', 'Operands must be in 8-bit binary format'];

        // parse operand input
        let which1 = num1.split('').map(c => c === '1');
        let which2 = num2.split('').map(c => c === '1');
        let stack1 = addend1.map((src, idx) => {
            return { x: src[0], y: src[1], id: src[2], mode: which1[idx] ? 'on' : 'off' };
        });
        let stack2 = addend2.map((src, idx) => {
            return { x: src[0], y: src[1], id: src[2], mode: which2[idx] ? 'on' : 'off' };
        });

        // gather DFS sources
        let adder = [{ x: 1382.2, y: 886.4, id: 1632, mode: 'off' }];
        let xorer = [{ x: 1382.2, y: 1102.5, id: 1754, mode: 'off' }];
        let ander = [{ x: 1382.2, y: 1246.4, id: 1649, mode: 'off' }];
        let carry = [{ x: 1156.2, y: 345.8, id: 1929, mode: 'off' }];
        let srcs = sources.map((src) => {
            let id = tree.nearest({ x: src[0], y: src[1] }, 1)[0][0].id;
            return { x: src[0], y: src[1], id, mode: 'on' };
        });

        // set operation type
        if (op === 'add') adder[0].mode = 'on';
        else if (op === 'and') ander[0].mode = 'on';
        else if (op === 'xor') xorer[0].mode = 'on';
        else return 'Invalid operation supplied';

        // combine DFS sources
        let big_stack = stack1.concat(stack2, adder, ander, xorer, carry, srcs);

        // execute DFS
        let res = dfbss(big_stack, anim_delay);

        return res;
    }

    function sleep(ms) {
        return new Promise(resolve => setTimeout(resolve, ms));
    }

    async function flash(id) {
        $(`#${id}`).addClass("flash");
        await setTimeout(() => {
            $(`#${id}`).removeClass("flash");
        }, 1);
    }

    dfbss = async (stack, delay = 0) => {
        // stack = [{ x, y, id, mode }];
        let stopwatchStart = new Date().getTime();
        let i = 0;
        while (stack.length > 0) {
            i += 1;
            if (i > 99999) return 'Maximum computation time exceeded';

            const thisPoint = stack.pop();
            const thisSeg = table[thisPoint.id];
            const nextX = thisPoint.x === thisSeg.x1 ? thisSeg.x2 : thisSeg.x1;
            const nextY = thisPoint.y === thisSeg.y1 ? thisSeg.y2 : thisSeg.y1;
            const nextPoint = { x: nextX, y: nextY, id: thisPoint.id, mode: thisPoint.mode };

            $('#cycles').text(`Cycle ${i}, current segment #${thisPoint.id}`);
            visited.add(thisPoint.id);

            let intersectingPoints = tree.nearest(nextPoint, 4, 0);
            let nextPoints = intersectingPoints.filter(
                point => point[0].id !== thisPoint.id).filter(
                    point => point[1] < 0.1);

            // light up segment on diagram
            if (thisPoint.mode === 'on') {
                if (delay > 0) flash(thisPoint.id);
                $(`#${thisPoint.id}`).addClass("on"); //$(`#${thisPoint.id}`).css("stroke", randomColor());//
                on.add(thisPoint.id);
            } else if (thisPoint.mode === 'off') {
                $(`#${thisPoint.id}`).addClass("off"); //$(`#${thisPoint.id}`).css("stroke", randomColor());
            }
            // animation delay
            if (delay > 0 && thisPoint.mode === 'on') await sleep(delay);

            // handle 4-way intersections
            if (nextPoints.length === 3) {
                // if intersection is ambiguous, queue this point for later
                if (thisPoint.mode === 'on') {
                    let ids = nextPoints.map(point => point[0].id);
                    let isBlocked = ids.map(id => visited.has(id) && on.has(id)).reduce((a, b) => a + b) === 2;
                    let isIndeterminate = ids.map(id => visited.has(id)).reduce((a, b) => a + b) === 0;

                    let ourSlope = slope(thisSeg);
                    nextPoints = nextPoints.filter(
                        point => {
                            let theirSlope = slope(table[point[0].id]);
                            return ourSlope === theirSlope || Math.abs(ourSlope - theirSlope) < 0.1;
                        }
                    );
                    let nextPoint = nextPoints[0][0];
                    let nextSeg = table[nextPoint.id];
                    let ep1 = tree.nearest({ x: nextSeg.x1, y: nextSeg.y1 }, 4).filter(x => x[1] === 0).length;
                    let ep2 = tree.nearest({ x: nextSeg.x2, y: nextSeg.y2 }, 4).filter(x => x[1] === 0).length;

                    if (ep1 === 1 || ep2 === 1) {
                        // if stub, pass
                    } else if (isIndeterminate) {
                        // if indeterminate, queue the point for later
                        stack.unshift(thisPoint);
                        continue;
                    } else if (isBlocked) {
                        // if blocked, quit and resume traversal in 'off' mode
                        nextPoint.mode = 'off';
                        stack.push(nextPoint);
                        continue;
                    }
                }
                // continue propagating in same direction only
                let ourSlope = slope(thisSeg);
                nextPoints = nextPoints.filter(
                    point => {
                        let theirSlope = slope(table[point[0].id]);
                        return ourSlope === theirSlope || Math.abs(ourSlope - theirSlope) < 0.1;
                    }
                );
            }
            // push next points onto stack
            nextPoints.forEach(point => {
                let id = point[0].id;
                let x = point[0].x;
                let y = point[0].y;
                let mode = thisPoint.mode;

                stack.push({ x, y, id, mode });
            });
        }

        let stopwatchEnd = new Date().getTime();

        // reap result directly from svg
        let output = out.map((id) => {
            let cls = $(`#${id}`)[0].getAttribute('class');
            let type = cls.split(' ')[1];
            return type === 'on' ? 1 : 0;
        });

        return [output.join(''), `Finished in ${(stopwatchEnd - stopwatchStart) / 1000} sec with ${i} cycles`];
    }
</script>
